import React, { useEffect, useState } from "react";
import axios from "axios";
import { Box, Button } from "@material-ui/core";
import "./App.css";

function App() {
  const [info, Setinfo] = useState([]);
  const [index, setIndex] = useState(null);
  const fetchData = async () => {
    const infodata = await axios.get("https://reqres.in/api/users?page=2");
    Setinfo(infodata.data.data);
  };
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="App">
      <h1>{index}</h1>
      <PersonCard/>
      {info.map((place, i) => (
        <div className="bt" key={i}>
          <Button variant="contained" key={i} onClick={() => setIndex(i)}>
            {i + 1}
          </Button>
        </div>
      ))}
    </div>
  );
}

export default App;
